import React, { useState, useEffect } from 'react';
import axios from 'axios';
import {
    createStyles,
    Paper,
    Table,
    TableBody,
    TableCell,
    TableHead,
    TableRow,
    Theme,
    withStyles,
    WithStyles,
} from '@material-ui/core';
import _ from 'lodash';
import { useSelector } from 'react-redux';

const userstate = {
    datarecords: []
};

const UserTable = (state: any) => {
    
    //let datarecords = state;
    //datarecords: [];
    const users: any[] = [];
    axios.defaults.headers.common['Authorization'] = 'Bearer eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJVc2VybmFtZSI6InN1amFzaHJlZSIsIlBhc3N3b3JkIjoicGFzcyIsIm5iZiI6MTU4NjI1MzY0NiwiZXhwIjoxNTg2MjU0MjQ2LCJpc3MiOiJodHRwczovL2xvY2FsaG9zdDo0NDM5IiwiYXVkIjoiaHR0cHM6Ly9sb2NhbGhvc3Q6NDQzOSJ9.7MIOPycKKDtYG9KrP_zD4beGq37HFyNibXrapeOlu2I';
    axios.get('https://localhost:44391/api/Dashboard')
        .then(response => {
            //datarecords = response.data;
            users.push(response.data);
            console.log(users);
            console.log(users[0]);
            const list: any[] = users[0];
            console.log("========");
            console.log(list);
            //state.datarecords= response.data;
            //console.log(datarecords);
        })
        .catch(error => {

        })
    return (
        <Paper >
            <h2>Employee List</h2>

            <Table >
                <TableHead>

                    <TableRow>
                        <TableCell><strong>Id</strong></TableCell>
                        <TableCell><strong>Name</strong></TableCell>
                        <TableCell><strong>Username</strong></TableCell>
                        <TableCell><strong>Email</strong></TableCell>
                    </TableRow>
                    
                    
                </TableHead>
                <TableBody>
                    {users.map(row => {
                        return (

                            <TableRow key={row[0]["user_id"]}>
                                <TableCell>{row[0]["user_id"]}</TableCell>
                                <TableCell>{row[0]["fullname"]}</TableCell>
                                <TableCell>{row[0]["username"]}</TableCell>
                                <TableCell>{row[0]["useremail"]}</TableCell>

                            </TableRow>
                        );
                    })}
                </TableBody>  
            </Table>
        </Paper>

    );
}

export default UserTable;
